import React from "react";
import styled from "styled-components";
import InputBox from "../components/Share/InputBox";

const Background = styled.div`
  width: 100vw;
  min-height: 100vh;
  background: #fdfbf8;

  display: flex;
  justify-content: center;
  align-items: center;
`;

const Box = styled.div`
  width: 540px;
  height: 746px;
  border: 1px solid black;
`;

const TitleText = styled.div`
  color: #000;
  font-family: Roboto;
  font-size: 32px;
  font-style: normal;
  font-weight: 600;
  line-height: 40px;
`;

const InputEmpty = styled.input`
  width: 350px;
  height: 50px;
  flex-shrink: 0;
  border-radius: 10px;
  border: 2px solid #000;
  background: #fdfbf8;
  padding: 10px; /* 내부 여백 */
  font-size: 16px; /* 입력 글씨 크기 */
  box-sizing: border-box;

  margin-top: 20px;
`;

const RowContainer = styled.div`
  //인증번호 부분 가로 배열 위해서
  height: ${(props) => props.height || "100%"};

  display: flex; /* Flexbox 활성화 */
  flex-direction: row; /* 가로 배치 */
  align-items: center; /* 세로 정렬 가운데 */
  gap: 50px; /* 요소 사이 간격 */

  border: 1px solid black;
  box-sizing: border-box;
`;

const VerifyNumber = styled.button`
  display: flex;
  width: 140px;
  height: 50px;
  padding: 5px;
  justify-content: center;
  align-items: center;
  gap: 5px;
  flex-shrink: 0;
  border-radius: 10px;
  border: 2px solid #000;
  background: #aabda2;

  color: #fdfbf8;
  font-family: Roboto;
  font-size: 20px;
  font-style: normal;
  font-weight: 400;

  margin-top: 70px;

  box-sizing: border-box;
`;

export default function Signup() {
  return (
    <Background>
      <Box>
        <TitleText>회원가입</TitleText>
        <InputBox label="이름" type="text"></InputBox>
        <RowContainer height="120px">
          <InputBox label="이메일" type="email"></InputBox>
          <VerifyNumber>인증번호 요청</VerifyNumber>
        </RowContainer>
        <InputEmpty></InputEmpty>
        <InputBox label="닉네임" type="email"></InputBox>
        <InputBox label="비밀번호" type="password"></InputBox>
      </Box>
    </Background>
  );
}
